package com.Stream.entity;

import java.io 

.Serializable;

public class CarShop  extends BaseEntity implements Serializable {
	private Game game;
	private Long number;
		
	public CarShop() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	public CarShop(Game game, Long number) {
		super();
		this.game = game;
		this.number = number;
	}

	public Game getGame() {
		return game;
	}
	public void setGame(Game game) {
		this.game = game;
	}
	public Long getNumber() {
		return number;
	}
	public void setNumber(Long number) {
		this.number = number;
	}
	
	
}
